import React from "react";

const Breadcrumb = ({ selectedRow }) => {
  let breadcrumb = null;

  if (selectedRow) {
    const pathArray = selectedRow.split("/");

    breadcrumb = (
      <div className="breadcrumb">
        {pathArray.map((path, index) => (
          <span key={index}>{path}</span>
        ))}
      </div>
    );
  }

  return breadcrumb;
};

export default Breadcrumb;
